import React, { Component } from "react";
import "./signin.css";
//import tachyons from "tachyons";

class Signin extends Component {
    render(props){
        const {onRouteChange} = this.props;
    return(
        <main className="container">

            <div className="inner-container">
                <p>Already a user? Sign in now</p>
                <div className="email"><input type="email" placeholder="Email" /></div>
                <div className="password"><input type= "password" placeholder="password"></input></div>
                <div className="button"><button onClick={() => onRouteChange('home')}>Sign in</button></div>
                <p>New user? <span className="span" onClick={() => onRouteChange('register')}>Register Now</span></p>
            </div>
        </main>
    ) 
    };
};

export default Signin;
